import React from 'react';
import { Card } from 'react-bootstrap';
// import './Service.css'

const Service = (props) => {
    const { title, body, image, price } = props.service;
    return (
        <>
            <col >

                <img src={image} alt="" />
                <h3>{title}</h3>
                <p>{price}</p>
                <p className="px-3">{body}</p>

            </col >
        </>
    );
};

export default Service;
